import React from 'react';
import {
    Table,
    THead,
    TBody,
    TRow
} from "./Table";
import UUID from 'uuidjs';

const TrackTable = ({ cols, items, className, onClickRow = x => null }) => {

    console.log("items", items)
    return (
        <Table className={"track-table" + className}>
            <THead cols={cols} />
            <TBody>
                {(items && items.length > 0) &&
                    items.map((item, i) =>
                        <TRow
                            cols={cols}
                            data={{...item, index: i + 1}}
                            key={UUID.genV1()}
                            onClick={onClickRow.bind(i, item.id)} />
                    )
                }
            </TBody>
        </Table>
    )
}

export default TrackTable;
